import React, { useState, useEffect } from "react";
import axios from "axios";
import { LabOverview } from "../../Lab Overview/LabOverview";

export const DivWrapper = ({ onViewProfile }) => {
  const [labs, setLabs] = useState([]);
  const [showLabOverview, setShowLabOverview] = useState(false);

  useEffect(() => {
    const fetchLabs = async () => {
      try {
        const response = await axios.get("http://localhost:8080/api/labs");
        setLabs(response.data.data);
        console.log(response.data.data);
      } catch (error) {
        console.error("Error fetching lab data", error);
      }
    };

    fetchLabs();
  }, []);

  return (
    <>
      {showLabOverview ? (
        <LabOverview />
      ) : (
        <div className="flex flex-col w-[1580px] items-start gap-5 absolute top-[441px] left-[60px]">
          {labs.length === 0 ? (
            <div>Loading labs...</div>
          ) : (
            labs.map((lab) => (
              <div
                key={lab.id}
                className="flex flex-col w-[1060px] items-start gap-4 p-8 bg-white rounded-2xl border border-[#cbcbcb] shadow-[0px_0px_15px_#0000000d]"
              >
                <div className="flex gap-[18px]">
                  <img
                    className="w-[106px] h-[106px] object-cover"
                    alt="Logo"
                    src={lab.logo}
                  />
                  <div className="flex flex-col justify-between">
                    <h2 className="text-xl font-bold text-[#202224]">
                      {lab.company_name}
                    </h2>
                    <p>{lab.description}</p>
                    <div><strong>Accreditation:</strong> {lab.accreditation}</div>
                    <div><strong>Location:</strong> {lab.location}</div>
                    <div><strong>Expertise:</strong> {lab.expertise}</div>
                    <div><strong>Industries:</strong> {lab.industries.join(", ")}</div>
                  </div>
                </div>
                <div className="flex gap-4 mt-4">
                  <div className="text-[#d50000] font-medium cursor-pointer">
                    Delete
                  </div>
                  <button
                    onClick={() => setShowLabOverview(true)}
                    className="flex items-center gap-2 px-4 py-2 rounded-2xl border border-[#dddddd] text-[#6161ff]"
                  >
                    <img
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/building-user--1--1.svg"
                      alt="View Profile"
                      className="w-6 h-6"
                    />
                    View Profile
                  </button>

                  <button
                    className="flex items-center gap-2 px-4 py-2 rounded-2xl border border-[#dddddd] text-[#6161ff]"
                  >
                    <img
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/comment-1.svg"
                      alt="Get Quote"
                      className="w-6 h-6"
                    />
                    Get Quote
                  </button>

                </div>
              </div>
            ))
          )}
        </div>
      )}
    </>
  );
};
